const Tete=()=>{
    return(
      <header>
        <nav className='tete'>
          <img src={logo} className="App-logo" alt="logo" />
          <ul>
            <li>Prix</li>
            <li>A propos</li>
            <li>Contacts</li>
          </ul>
        </nav>
      </header>
    )
  }
  export default Tete
